import React from 'react';
import '../Duration.css';

function Duration1(){
    return (
        <div >
            
            <h2>กรุณาเลือกช่วงเวลา</h2>
            <button type="button" class="btn btn-primary btn-lg">Large</button>
            <button type="button" class="btn btn-outline-info" >ช่วงที่ 1</button><br></br>
            
            
        </div>
    );
}
export default Duration1;
